import React from "react";
import back from "../img/bckground.png";
const Home = () => {
  return (
    <div className="home">
      <div className="continer">
        <div className="about" id="about">
          <h2>About Us</h2>
          <figure></figure>
          <img src={back} alt="Logo" /> 

          <p>
            Lorem ipsum dolor sit amet consectetur adipisicing elit. Fugit blanditi
            <br />
          </p>
          <div className="gallery" id="gallery">
            
          </div> 
          <div className="feedback">
            <h1>Feedback</h1>
          </div>
        </div>
      </div>
    </div>
  );
};

export default Home;
